import {request} from "./request";

export function getCart(page) {
    return request({
        url: `/saler/cart/${page}`,
        method: 'get',
    })
}

export function deleteSalersById(id) {
    return request({
        url:`/saler/cart/${id}`,
        method:'delete',
    })
}
